function unique(input){
    if(input == null) {
        return "";
    } else {
        // remove all spaces
        input = input.replace(/\s/g,'');
        // remove trailing comma, if any
        input = input.replace(/,$/,"");
    }
    var a = input.split(",");
    a.sort();
    for(var i = 1;i < a.length;) {
        if(a[i-1] == a[i]) {
            a.splice(i, 1);
        }
        else {
            i++;
        }
    }
    var out = "";
    for(var j = 0; j < a.length; j++) {
        if (j > 0) {
            out = out + ",";
        }
        out = out + a[j];
    }
    return out;
}



